import React from "react";
import style from "../styleSheets/Hands.module.css";
import styled from "../styleSheets/App.module.css";
import classNames from 'classnames';
export default function Hands(props) {

  const fingers = classNames('finger', 'finger1')
  return (
    <div className={style.hand} >
      <div className={style.fist}></div>
      <div class={fingers}>></div>
      <div className={style.finger2} id={style.finger}></div>
      <div className={style.finger3} id={style.finger}></div>
      <div className={style.finger4} id={style.finger}></div>
      <div className={style.thumb}></div>
      <div className={style.arm}></div>
    </div>

  )
}
